  assemblies:
  - dotNetRDF
  namespace: VDS.RDF.Parsing.Tokens
  summary: "\nAn Asynchronous version of <xref href=\"VDS.RDF.Parsing.Tokens.BufferedTokenQueue\" data-throw-if-not-resolved=\"false\"></xref> which automatically Buffers as many Tokens as possible in a Background thread.\n"
  remarks: "\nPeriodic instablility is fixed to the best of my knowledge, it is still recommended to use a <xref href=\"VDS.RDF.Parsing.Tokens.BufferedTokenQueue\" data-throw-if-not-resolved=\"false\"></xref> or the basic <xref href=\"VDS.RDF.Parsing.Tokens.TokenQueue\" data-throw-if-not-resolved=\"false\"></xref>.  This implementation offers little/no performance improvement over the other types of Token Queue.\n"
  example: []
  syntax:
    content: 'public class AsynchronousBufferedTokenQueue : BufferedTokenQueue, ITokenQueue'
    content.vb: >-
      Public Class AsynchronousBufferedTokenQueue
          Inherits BufferedTokenQueue
          Implements ITokenQueue
